    false,nt"url": null,nt"notes": "The Code of Federal Regulations (CFR) is
    the codification of the general and permanent rules published in the Federal Register
    by the executive departments and agencies of the Federal Government. It is divided
    into 50 titles that represent broad areas subject to Federal regulation. Each print
    volume of the CFR is updated once each calendar year, and is issued on a quarterly
    basis. Bulk data downloads of Code of Federal Regulations files in XML format are
    available from 1996 to the present, by year, title, and volume. The current XML
    data set is not yet an official format of the Code of Federal Regulations. Only
    the PDF and Text versions have legal status as parts of the official online format
    of the Code of Federal Regulations. The XML-structured files are derived from SGML-tagged
    data and printing codes, which may produce anomalies in display. In addition, the
    XML data does not yet include image files. Users who require a higher level of assurance
    may wish to consult the official version of the Code of Federal Regulations on FDsys.gov.
    The FDsys data set includes digitally signed Code of Federal Regulations PDF files,
    which may be relied upon as evidence in a court of law. See: http://www.gpo.gov/fdsys/browse/collectionCfr.action?collectionCode=CFR",nt"license_title":
